import { Injectable } from '@angular/core';
import { ComplicationInsuffisanceSurrenalienne } from '../models/ComplicationInsuffisanceSurrenalienne';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class SurrenalineService {

  private apiUrl = 'https://localhost:7129/api/ComplicationInsuffisanceSurrenaliennes';

  constructor(private http: HttpClient) { }
  addsur(ComplicationInsuffisanceSurrenalienne: ComplicationInsuffisanceSurrenalienne): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationInsuffisanceSurrenalienne);

    return this.http.post<any>(`${this.apiUrl}/addsur`, ComplicationInsuffisanceSurrenalienne, { observe: 'response' });
  }}
